        }

        List<Double> reversedCoefficients = new ArrayList<>(xs);
        Collections.reverse(reversedCoefficients);

        List<Double> derivativeCoefficients = new ArrayList<>();
        for (int i = 1; i < reversedCoefficients.size(); i++) {
            derivativeCoefficients.add(reversedCoefficients.get(i) * i);
        }

        double x = 1.0;
        double epsilon = 0.0001;

        while (Math.abs(poly(xs, x)) > epsilon) {
