        int largestPrime = 0;

        // Find all prime factors of n
        for (int i = 2; i <= n; i++) {
            if (n % i == 0) {
                // Check if i is a prime number
                boolean isPrime = true;
                for (int j = 2; j < i; j++) {
                    if (i % j == 0) {
                        isPrime = false;
                        break;
                    }
                }

                // Update largest prime factor if i is prime
                if (isPrime) {
                    largestPrime = i;
                }
            }
        }

        return largestPrime;
    }
}

