    // Helper function to check if a list is palindromic
    private boolean isPalindromic(List<Integer> q) {
        int i = 0;
        int j = q.size() - 1;

        while (i < j) {
            if (!q.get(i).equals(q.get(j))) {
                return false;
            }
            i++;
            j--;
        }

        return true;
    }

