        // Split the input string into words
        String[] words = s.split(" ");

        // Initialize a StringBuilder to store the result
        StringBuilder result = new StringBuilder();

        // Iterate through each word in the input string
        for (String word : words) {
            // Convert the word to a character array
            char[] chars = word.toCharArray();

            // Sort the characters in ascending order based on ascii value
            Arrays.sort(chars);

            // Append the sorted characters back to the result
            result.append(chars);

            // Append a space after each word
            result.append(" ");
        }

        // Remove the extra space at the end of the result
        result.deleteCharAt(result.length() - 1);

        // Return the final result as a string
        return result.toString();
    }

