        // Define the alphabet
        String alphabet = "abcdefghijklmnopqrstuvwxyz";

        // Initialize a StringBuilder to store the encrypted string
        StringBuilder encrypted = new StringBuilder();

        // Iterate through each character in the input string
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);

            // Check if the character is a letter
            if (Character.isLetter(c)) {
                // Find the index of the character in the alphabet
                int index = alphabet.indexOf(Character.toLowerCase(c));

                // Calculate the new index after rotating down by two multiplied to two places
                int newIndex = (index + 2 * 2) % alphabet.length();

                // Append the encrypted character to the StringBuilder
                if (Character.isUpperCase(c)) {
                    encrypted.append(Character.toUpperCase(alphabet.charAt(newIndex)));
                } else {
                    encrypted.append(alphabet.charAt(newIndex));
                }
            } else {
                // Append non-letter characters as is
                encrypted.append(c);
            }
        }

        // Convert the StringBuilder to a String and return the encrypted string
        return encrypted.toString();
    }

